import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import styles from './landing.module.css'; 
import construction from './construction.png';
import contractor from './contractor.png';
import homebuilder from './homebuilder.png';
import homeowner from './homeowner.png';

const useStyles = makeStyles((theme) => ({
    root: {
      maxWidth: '100%',
      background:'#2B64D2',
    },
    babyCards:{
        background:'#2B64D2',
        maxWidth: '600px',
        minWidth: '200px',
        textAlign:'center',
        position: 'relative',
        height:'300px',
    }
}));
export default function Banners ()  {
    const classes = useStyles();
    return(
        <div>
            <Card className={classes.root}>
                <CardActionArea>
                <Grid container spacing={0}>
                    <Grid item xs>
                        <h1 className={styles.firstBannerH1}>What is Trademingle?</h1>
                        <p className={styles.firstBannerP}>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Sit amet nisl suscipit adipiscing bibendum. Penatibus et magnis dis parturient montes nascetur ridiculus mus mauris. Tristique senectus et netus et malesuada fames. Mauris pellentesque pulvinar pellentesque habitant morbi tristique. Ornare arcu dui vivamus arcu felis bibendum. Sed libero enim sed faucibus turpis. Tempor id eu nisl nunc mi ipsum faucibus vitae aliquet. Lorem ipsum dolor sit amet consectetur adipiscing elit pellentesque. Sit amet volutpat consequat mauris. Mi quis hendrerit dolor magna eget est lorem ipsum. Aliquam ut porttitor leo a diam. Eu scelerisque felis imperdiet proin fermentum leo vel. Lacus luctus accumsan tortor posuere ac ut. Non sodales neque sodales ut etiam. Fusce id velit ut tortor pretium viverra suspendisse potenti nullam. Elementum eu facilisis sed odio. Nibh venenatis cras sed felis eget velit aliquet. Amet tellus cras adipiscing enim eu turpis egestas. Id cursus metus aliquam eleifend mi in.</p>
                    </Grid>
                    <Grid item xs>
                        <img src={construction} className={styles.firstBannerImg} alt=''/>
                    </Grid>
                </Grid>
                </CardActionArea>
            </Card>
            {/* <h1 className={styles.header3}>Who are you?</h1> */}
            <div className={styles.secondBanner}>
                <Grid container spacing={5}>
                    <Grid item xs>
                        <Card className={classes.babyCards}>
                            <CardActionArea>
                                <img src={homeowner} className={styles.secondBannerImg} alt=''/>
                                <h2 className={styles.centeredText}>Home Owner</h2>
                            </CardActionArea>
                        </Card>
                    </Grid>
                    <Grid item xs>
                        <Card className={classes.babyCards}>
                            <CardActionArea>
                                <img src={homebuilder} className={styles.secondBannerImg} alt=''/>
                                <h2 className={styles.centeredText}>Home Builder</h2>
                            </CardActionArea>
                        </Card>
                    </Grid>
                    <Grid item xs>
                        <Card className={classes.babyCards}>
                            <CardActionArea>
                                <img src={contractor} className={styles.secondBannerImg} alt=''/>
                                <h2 className={styles.centeredText}>Contractor</h2>
                            </CardActionArea>
                        </Card>
                    </Grid>
                </Grid>
            </div>
        </div>
    )
}
